write code for me image upload in php
model
Sure, here is the code for image upload in php:

```php
<?php
$target_dir = 'uploads/';
$target_file = $_FILES['image']['name'];
$target_type = $_FILES['image']['type'];
$target_size = $_FILES['image']['size'];

if (move_uploaded_file($_FILES['image']['tmp_name'], $target_dir.$target_file)) {
  echo "Image uploaded successfully";
} else {
  echo "Error uploading image";
}
?>
```

This code will move the uploaded image to the specified directory and store its name in the database.

The code includes the following variables:

```php
$target_dir: The target directory for the uploaded image
$target_file: The target file name for the uploaded image
$target_type: The target file type for the uploaded image
$target_size: The target file size for the uploaded image
```

If the move_uploaded_file function fails, the script will output an error message.

The script also includes the following variables:

```php
$image_name: The name of the uploaded image
$image_type: The type of the uploaded image
$image_size: The size of the uploaded image
```

These variables can be used to store information about the uploaded image in the database.

```php
$image_name = $_FILES['image']['name'];
$image_type = $_FILES['image']['type'];
$image_size = $_FILES['image']['size'];

echo "Image name: $image_name";
echo "Image type: $image_type";
echo "Image size: $image_size";
```

The script will output the name, type, and size of the uploaded image.

The script also includes the following variables:

```php
$image_url: The URL of the uploaded image
```

The script can store the image URL in the database.

```php
$image_url = $_FILES['image']['url'];

echo "Image URL: $image_url";
```

The script will output the image URL.

```php
$image_url = $_FILES['image']['url'];

echo "Image URL: $image_url";
```

The script will output the image URL

